import React from 'react';
import './Cards.css';
import CardItem from './CardItem';
import img1 from './images/image7.jpg';
function Cards() {
  return (
    <div className='cards'>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
            <CardItem
              src={img1}
              text='Diabetes Care'
            />
            <p>SugarWise is a comprehensive web platform designed to empower healthcare professionals in making informed decisions for their diabetic patients. We provide a suite of advanced tools and resources to streamline the diagnosis confirmation process and optimize medication recommendations.</p>
            <CardItem
              src={img1}
              text='Travel through the Islands of Bali in a Private Cruise'
              label='Luxury'
              path='/services'
            />
          </ul>
          <ul className='cards__items'>
            <CardItem
              src={img1}
              text='Set Sail in the Atlantic Ocean visiting Uncharted Waters'
              label='Mystery'
              path='/services'
            />
            <CardItem
              src={img1}
              text='Experience Football on Top of the Himilayan Mountains'
              label='Adventure'
              path='/products'
            />
            <CardItem
              src={img1}
              text='Ride through the Sahara Desert on a guided camel tour'
              label='Adrenaline'
              path='/sign-up'
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
